import React, { useState } from "react";
import { Form, Input } from "antd";

export default (props: { setType: Function; setName: Function }) => {
  return (
    <Form className="Options">
      <Form.Item label="Search by name" style={{ marginBottom: 0 }}>
        <Input placeholder="Name"></Input>
      </Form.Item>
      <Form.Item label="Search by type" style={{ marginBottom: 0 }}>
        <Input placeholder="Type"></Input>
      </Form.Item>
    </Form>
  );
};
